    <p>2011 年的文章了。之前有人好奇為什麼競品的網站有下這個 meta tag，這篇文章就可以回答了。另外再給一篇 2017 年的文章 <a href="https://yoast.com/meta-keywords/">https://yoast.com/meta-keywords/</a></p>
