    <h1>近期改動</h1>
    <h2>官網 banner 加入 webp</h2>
    <p>初始載入速度從 14 秒變成 5 秒 (chrome only)</p>
    <img alt="1" src="data:image/jpeg;base64,">
    <h2>讓站內搜尋結果有獨立頁面</h2>
    <p>讓內容單純化。不讓搜尋結果跟頁面內容疊在一起，但會讓使用者多載一頁</p>
    <sup>By the way, 官網站內搜尋目前使用率是 0</sup>
    <h2>Google 我的商家</h2>
    <p>結合 google map，出現在搜尋結果右邊的區塊。</p>
    <p>可以編輯資訊、新增圖片與 100~300 字的活動或文章。</p>
